import React from "react";
import "./tablePopup.css";

function tablePopup(props) {
  return props.trigger ? (
    <div className="popup">
      <div className="popup-inner">
        {/* {props.children} */}
        <h3>{props.name}</h3>
        <button className="close-btn" onClick={() => props.setTrigger(false)}>
          Agree
        </button>
      </div>
    </div>
  ) : (
    ""
  );
}

export default tablePopup;
